svg.script:
		var svgNS = "http://www.w3.org/2000/svg";
		var cartoNS = "http://www.carto.net/attrib";
		var xlinkNS = "http://www.w3.org/1999/xlink";
		var dtmNS = "http://www.karto.ethz.ch/dtm";
		var myMapApp = new mapApp();
		var myMainMap;
		var myRefMapDragger;
		var myZoomSlider;
		//selectionLists
		var selTrailChoiceByAttribute;
		var selTrailDifficulty;
		var selTrailDuration;
		var selTrailLocation;
		var selPhotoKeyword;
		var selTrailName;
		var selTrailNameSub;
		//global object for DTM
		var myDTM;
		//global variables for legend
		var activeLegend="none";
		var activeLegendId="none";
		var geologyThreshold = 10000;
		//photoGallery variables
		var photoGallery = new Array();
		var selectedPhotos;
		var photoGalleryOffset = 0;
		//trail variables
		var trailCollection = new Array();
		var stayCollection = new Array();

		function init(evt) {
			//dynamic layer array that allow loading from database
			var dynamicLayers = new Array();
			dynamicLayers["landcover"] = {"key":"landcover","value":"yes","loaded":"no"};
			dynamicLayers.push(dynamicLayers["landcover"]);
			dynamicLayers["geology"] = {"key":"geology","value":"no","loaded":"no"};
			dynamicLayers.push(dynamicLayers["geology"]);
			dynamicLayers["buildings"] = {"key":"buildings","value":"no","loaded":"no"};
			dynamicLayers.push(dynamicLayers["buildings"]);
			dynamicLayers["hydrology"] = {"key":"hydrology","value":"yes","loaded":"no"};
			dynamicLayers.push(dynamicLayers["hydrology"]);
			dynamicLayers["transportation"] = {"key":"transportation","value":"yes","loaded":"no"};
			dynamicLayers.push(dynamicLayers["transportation"]);
			dynamicLayers["contours"] = {"key":"contours","value":"no","loaded":"no"};
			dynamicLayers.push(dynamicLayers["contours"]);
			dynamicLayers["trails"] = {"key":"trails","value":"no","loaded":"no"};
			dynamicLayers.push(dynamicLayers["trails"]);
			dynamicLayers["elevation"] = {"key":"elevation","value":"yes","loaded":"no"};
			dynamicLayers.push(dynamicLayers["elevation"]);
			//initialize digiLayers (layers that allow digitizing)
			var digiLayers = new Array();
			myMainMap = new map("mainMap",64000,640,0.6,0,26911,"m",1,true,"coordX","coordY",dynamicLayers,digiLayers,"",zoomRectStyles,highlightStyles,dragRectStyles,"referenceMap","myDragCrossSymbol",4750);
			//initialize lod warning
			myMainMap.lodWarning = false;
			//create zoom slider
			myMapApp.zoomSlider = new slider(710,65,myMainMap.minWidth,710,165,myMainMap.maxWidth,myMainMap.maxWidth,"mapZoomSlider","dimgray",2,10,"sliderSymbol",myMapApp.refMapDragger,true);
			//now initialize buttons
			myMapApp.buttons = new Array();
			//groupId,functionToCall,buttonType,buttonText,buttonSymbolId,x,y,width,height,textStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,shadowOffset
			myMapApp.buttons["zoomIn"] = new button("zoomIn",zoomImageButtons,"rect",undefined,"magnifyerZoomIn",703,42,14,14,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["zoomOut"] = new button("zoomOut",zoomImageButtons,"rect",undefined,"magnifyerZoomOut",703,174,14,14,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["infoButton"] = new switchbutton("infoButton",zoomImageSwitchButtons,"rect",undefined,"infoBut",731,72,18,18,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["infoButton"].setSwitchValue(true,false);
			statusChange("Mode: Infomode");
			myMapApp.buttons["zoomFull"] = new button("zoomFull",zoomImageButtons,"rect",undefined,"magnifyerFull",761,72,18,18,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["zoomManual"] = new switchbutton("zoomManual",zoomImageSwitchButtons,"rect",undefined,"magnifyerManual",791,72,18,18,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["panManual"] = new switchbutton("panManual",zoomImageSwitchButtons,"rect",undefined,"symbPan",821,72,18,18,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["recenterMap"] = new switchbutton("recenterMap",zoomImageSwitchButtons,"rect",undefined,"symbRecenter",851,72,18,18,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["backwardExtent"] = new button("backwardExtent",zoomImageButtons,"rect",undefined,"symbArrowLeft",881,72,18,18,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			myMapApp.buttons["forwardExtent"] = new button("forwardExtent",zoomImageButtons,"rect",undefined,"symbArrowRight",911,72,18,18,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			//bigphotoclose button
			myMapApp.buttons["closeBigPhotoButton"] = new button("closeBigPhotoButton",closeBigPhoto,"rect","Back",undefined,900,695,50,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1.2);
			//create array for Windows
			myMapApp.Windows = new Array();
			myMapApp.Windows["Liability"] = new Window("Liability","Windows",430,150,250,250,true,0,0,1100,768,true,winPlaceholderStyles,windowStyles,3,true,false,"Liability","",true,true,true,titlebarStyles,titlebarHeight,statusbarStyles,statusbarHeight,titletextStyles,statustextStyles,windowButtonStyles,undefined);
			myMapApp.Windows["Liability"].appendContent("liability",true);
			myMapApp.Windows["Liability"].close();
			//create array for textboxes
			myMapApp.textboxes = new Array();

			//see if we need to disable buttons
			myMainMap.checkButtons();
			//load geo-data
			loadProjectSpecific();
			//load photos
			var getPhotoDataObj = new getData('xml/photos.xml',parsePhotos,"xml");
			getPhotoDataObj.getData();
			//load traildata
			var getTrailDataObj = new getData('xml/trails.xml',parseTrails,"xml");
			getTrailDataObj.getData();
			//load information data
			myMapApp.information = new Array();
			var getInfoDataObj = new getData('xml/information.xml',parseInformation,"xml");
			getInfoDataObj.getData();
			//initialize selectionLists and comboboxes
			myMapApp.selectionlists = new Array();
			myMapApp.comboboxes = new Array();
			var trailChoiceByAttribute = new Array("Name","Difficulty","Duration","Location");
			selTrailChoiceByAttribute = new selectionList("selTrailChoiceByAttribute",trailChoiceByAttribute,80,662,398,selBoxCellHeight,selBoxTextpadding,4,selBoxtextStyles,selBoxStyles,selBoxScrollbarStyles,selBoxSmallrectStyles,selBoxHighlightStyles,selBoxTriangleStyles,0,false,true,trailAttribSelected);
			var trailDifficulties = new Array("easy","easy-moderate","moderate","moderate-difficult","difficult","very difficult");
			selTrailDifficulty = new selectionList("selTrailDifficulty",trailDifficulties,115,752,398,selBoxCellHeight,selBoxTextpadding,4,selBoxtextStyles,selBoxStyles,selBoxScrollbarStyles,selBoxSmallrectStyles,selBoxHighlightStyles,selBoxTriangleStyles,0,false,true,trailDifficultySelected);
			var trailDurations = new Array("1-3","4-6","7-9","10-12","48-72");
			selTrailDuration = new selectionList("selTrailDuration",trailDurations,50,752,398,selBoxCellHeight,selBoxTextpadding,5,selBoxtextStyles,selBoxStyles,selBoxScrollbarStyles,selBoxSmallrectStyles,selBoxHighlightStyles,selBoxTriangleStyles,0,false,true,trailDurationSelected);
			var trailLocations = new Array("Glacier Point Road","Hetch Hetchy","Tioga Road","Tuolumne Meadows","Wawona","Yosemite Valley");
			selTrailLocation = new selectionList("selTrailLocation",trailLocations,135,752,398,selBoxCellHeight,selBoxTextpadding,5,selBoxtextStyles,selBoxStyles,selBoxScrollbarStyles,selBoxSmallrectStyles,selBoxHighlightStyles,selBoxTriangleStyles,0,false,true,trailLocationSelected);
			var legend = new Array("Hydrology","Landcover","Heights","Transportation","Geology","Features");
			var selLegend = new selectionList("selLegend",legend,100,845,281,selBoxCellHeight,selBoxTextpadding,5,selBoxtextStyles,selBoxStyles,selBoxScrollbarStyles,selBoxSmallrectStyles,selBoxHighlightStyles,selBoxTriangleStyles,0,false,false,legendSelected);
			//initialize checkboxes
			myMapApp.checkboxes = new Array();
			myMapApp.radioButtonGroups = new Array();
			myMapApp.checkboxes["hydrology"] = new checkBox("hydrology","mapLayerControls",0,20,"checkBoxRect","checkBoxCross",true,"Hydrology",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["landcover"] = new checkBox("landcover","mapLayerControls",0,38,"checkBoxRect","checkBoxCross",true,"Landcover",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["contours"] = new checkBox("contours","mapLayerControls",0,56,"checkBoxRect","checkBoxCross",false,"Contours",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["elevation"] = new checkBox("elevation","mapLayerControls",0,74,"checkBoxRect","checkBoxCross",true,"Elevation",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["transportation"] = new checkBox("transportation","mapLayerControls",120,20,"checkBoxRect","checkBoxCross",true,"Transportation",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["trails"] = new checkBox("trails","mapLayerControls",120,38,"checkBoxRect","checkBoxCross",false,"Trails",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["buildings"] = new checkBox("buildings","mapLayerControls",120,56,"checkBoxRect","checkBoxCross",false,"Buildings",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["geology"] = new checkBox("geology","mapLayerControls",120,74,"checkBoxRect","checkBoxCross",false,"Geology",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["hillshade"] = new checkBox("hillshade","mapLayerControls",261,20,"checkBoxRect","checkBoxCross",true,"Shaded Relief",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["ortho"] = new checkBox("ortho","mapLayerControls",261,38,"checkBoxRect","checkBoxCross",false,"Orthophoto (Terraserver)",labeltextStyles,12,undefined,cbMapLayer);
			myMapApp.checkboxes["dtm"] = new checkBox("dtm","mapLayerControls",261,56,"checkBoxRect","checkBoxCross",false,"DTM (show Z values)",labeltextStyles,12,undefined,cbMapLayer);
			//initialize tabgroup and append content
			//this setTimeout is because of a bbox bug of Firefox with scripts called "onload"
			window.setTimeout("createTabs()",200);
			//Initialize Tooltip
			window.setTimeout("iniTooltips()",500);
		}

		function iniTooltips() {
			//this function is separate because of the bbox bug in Firefox
			myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,20,20,3);
			myMapApp.addTooltip("zoomIn","Zoom In",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("zoomOut","Zoom Out",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("infoButton","Info Mode",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("zoomFull","Full View",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("zoomManual","Zoom Rectangle Mode",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("panManual","Pan Mode",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("recenterMap","Recenter Map Mode",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("backwardExtent","Go Back in View History",false,false,"currentTarget",undefined);
			myMapApp.addTooltip("forwardExtent","Go Forward in View History",false,false,"currentTarget",undefined);
		}

		function createTabs() {
			var tabTitles = new Array("Trails","Photo Gallery","Search","Print Map","GPS","Information","Links","Credits");
			myMapApp.tabGroup = new tabgroup("tabGroup","tabGroup",580,365,520,398,16,"round","round",7.5,0,tabStyles,"lightskyblue",tabwindowStyles,tabtextStyles,tabTitles,0,false,undefined);
			myMapApp.tabGroup.addContent("trailsInfo",0,true);
			myMapApp.tabGroup.addContent("photogall",1,true);
			myMapApp.tabGroup.addContent("gpsGroup",4,true);
			myMapApp.tabGroup.addContent("links",6,true);
			myMapApp.tabGroup.addContent("acknowledgements",7,true);
			//initialize printing stuff
			initPrintingUI();
			//initialize information stuff
			initInformationUI();
			//initialize search stuff
			initSearchUI();
		}

		function loadProjectSpecific() {
			//generate timestamp
			var now = new Date();
			myMainMap.timestamp = now.getTime();
			//get vector layers
			getLayers();
			//update scalebar
			drawScaleBar();
			//get umn layers
			getRaster('hillshade',26911,"jpeg");
			//get orthoimage from terraserver
			getOrthoImage();
			//get new dtm from higrid cgi
			if (myDTM) {
				getDTM();
			}
			//check if we need to switch the geology legend
			if (myMapApp.Windows["Geology"]) {
				if (!myMapApp.Windows["Geology"].closed) {
					if (myMainMap.curWidth > geologyThreshold) {
						document.getElementById("legendgeology_gen").setAttributeNS(null,"display","inherit");
						document.getElementById("legendgeology_detailed").setAttributeNS(null,"display","none");
					}
					else {
						document.getElementById("legendgeology_gen").setAttributeNS(null,"display","none");
						document.getElementById("legendgeology_detailed").setAttributeNS(null,"display","inherit");
					}
				}
			}
			//update line-width of park boundary
			document.getElementById("park_boundary").setAttributeNS(null,"stroke-width",myMainMap.curWidth*0.005);
			//update stroke-width of printRect if available
			if (myMapApp.printObj) {
				if (myMapApp.printObj.printRect) {
					myMapApp.printObj.printRect.setAttributeNS(null,"stroke-width",myMainMap.curWidth * 0.0025);
				}
			}
		}

		function legendSelected(selBoxName,selNr,arrayVal) {
			if (!myMapApp.Windows[arrayVal]) {
				var arrayVal = arrayVal;
				var legend = document.getElementById("legend"+arrayVal);
				legend.setAttributeNS(null,"display","inherit");
				var bbox = legend.getBBox();
				var width = bbox.width + 20;
				if (width < 200) {
					width = 200;
				}
				myMapApp.Windows[arrayVal] = new Window(arrayVal,"Windows",width,(bbox.height + 35),700,330,true,0,0,1100,768,true,winPlaceholderStyles,windowStyles,3,true,false,"Legend "+arrayVal,"",true,true,true,titlebarStyles,titlebarHeight,statusbarStyles,statusbarHeight,titletextStyles,statustextStyles,windowButtonStyles,undefined);
				myMapApp.Windows[arrayVal].appendContent(legend,false);
			}
			else {
				myMapApp.Windows[arrayVal].open();
			}
			//check which geology legend to display
			if (arrayVal == "Geology") {
				if (myMainMap.curWidth > geologyThreshold) {
					document.getElementById("legendgeology_gen").setAttributeNS(null,"display","inherit");
					document.getElementById("legendgeology_detailed").setAttributeNS(null,"display","none");
				}
				else {
					document.getElementById("legendgeology_gen").setAttributeNS(null,"display","none");
					document.getElementById("legendgeology_detailed").setAttributeNS(null,"display","inherit");
				}
			}
		}

		function closePhoto(layer) {
			document.getElementById("phototrees").setAttributeNS(null,"display","none");
		}

		function switchLayer(layerName,visibility) {
			document.getElementById(layerName).setAttribute("visibility",visibility);
}
